import "./FooterStyles.css";

const Footer = () => {
  return (
    <div className="footer">
      <div className="top">
        <div>
          <h1>Dweller Affairs</h1>
          <p>Choose your next Apartment</p>
        </div>
        <div></div>
      </div>

      <div className="bottom"></div>
    </div>
  );
};

export default Footer;
